import React from 'react'
import './Archived.css'


export default function Tasks() {
  const classes = [
    "IAS - CSB3 2ND SEMESTER 2025",
    "THESIS | 2025",
    "PROGRAMMING LANGUAGE",
    "Math Elective",
    "Web Development",
    "Data Structures",
  ];
  return (
    <div >Tasks
      <div className="classes">
        {classes.map((cls, index) => (
          <div className="class-box" key={index}>
            <h2>{cls}</h2>
            <button>View</button>
          </div>
        ))}
      </div>
    </div>
    
  )
}
